import React from "react";
import Logo from '../assets/footer/Logotype.png';
import Facebook from '../assets/footer/Facebook.png';
import Instagram from '../assets/footer/Instagram.png';
import LinkedIn from '../assets/footer/Linkedin.png';
import Lines from '../assets/footer/Lines.png';
import './footer.css';
import { useTheme } from '../ThemeSwitch/ThemeContext';

const Footer = () => {
  const { isDarkTheme, themeStyles } = useTheme();

  return (
    <div className="Footer" style={{ background: themeStyles.background, color: themeStyles.color }}>
      <div className="footer_flex">
        <div><a href="#"><img src={Logo} alt="Logo"></img></a></div>
        <div className="content_footer">
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Platform</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Solutions</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">How it works</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Pricing</p></a>
        </div>
        <div className="content_footer">
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Company</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">About</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Our Mission</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Careers <span className="span"></span> </p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Contact</p></a>
        </div>
        <div className="content_footer">
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Resources</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Blog</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Help Center</p></a>
          <a href="#" style={{ color: themeStyles.color }}><p className="content_footer_p">Support</p></a>
        </div>
        <div className="social_links">
          <div className="social_footer"><a href="#"><img src={Facebook} alt="Facebook"></img> <p className="social_links_p" style={{ color: themeStyles.color }}>Follow us on Facebook</p></a> </div>
          <div className="social_footer margin_top"><a href="#"><img src={Instagram} alt="Instagram"></img> <p className="social_links_p" style={{ color: themeStyles.color }}>Follow us on Instagram</p></a> </div>
          <div className="social_footer margin_top"><a href="#"><img src={LinkedIn} alt="LinkedIn"></img> <p className="social_links_p" style={{ color: themeStyles.color }}>Follow us on LinkedIn</p></a> </div>
        </div>
      </div>
      <div className="bottom_footer">
        <img className="lines_footer" src={Lines} alt="Lines"></img>
        <p className="bottom_footer_p" style={{ color: themeStyles.color }}>© 2024 Flow. All rights reserved.</p>
      </div>
    </div>
  );
};

export default Footer;
